import React, { Fragment } from "react";

import Item from "./Item";

const ItemsList = (props) => {
  return (
    <Fragment>
      {props.items.map((item) => (
        <Item obj={item} />
      ))}
    </Fragment>
  );
};

export default ItemsList;
